// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.4.25 <0.9.0;
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

import "./VerifySignature.sol";
import "./LicenseTools.sol";
import "./LicenseToken.sol";
import "./ServiceManager.sol";
import "./UserMonitoringCenter.sol";


struct AddressInfo {
    bytes32 info1;
    bytes32 info2;
}

contract BlockchainUserCenter is AccessControl {
    using EnumerableSet for EnumerableSet.AddressSet;

    /******************************
        EVENTS
    ******************************/

    event FollowinUserPermissionSettled(address user, uint256 permissions);
    event FollowerUserPermissionSettled(address user, uint256 permissions);

    /******************************
        VARIABLES
    ******************************/

    uint private _blockchainId;

    bytes32 constant OWNER_ROLE = keccak256("OWNER_ROLE");
    bytes32 constant MANAGER_ROLE = keccak256("MANAGER_ROLE");

    // manager of the contract
    address private _owner;

    // manager owner address
    address private _managerOwner;

    // user manager address
    address private _userManager;

    // Declare a set state variable of address following
    mapping(address => uint256) _followingUsersPermissions;

    // Declare a set state variable of address followers
    mapping(address => uint256) _followersUsersPermissions;

    // Declare a set state variable of address followers
    mapping(address => bytes32) _nicknames;

    // Declare a set address information for savinf
    mapping(address => AddressInfo) _addressInfo;

    // Declare a set state variable of address of followin gUsers
    EnumerableSet.AddressSet _followingUsers;

    // Declare a set state variable of address of followers users
    EnumerableSet.AddressSet _followersUsers;
    //User Manager
    UserMonitoringCenter userMonitoringCenterInstance;
    //Service Manager
    ServiceManager serviceManagerInstance;
    //License Manager
    LicenseToken licenseTokenInstance;


    bool private initialized;
    bool _isActive = true;
    enum UserType {
        FOLLOWING,
        FOLLOWER
    }

    //Modifiers
    //  * @param userType true(FOLLOWING), false(FOLLOWERS)
    modifier onlyFollowingOrFollowerUsers(address user, UserType userType) {
        if (userType == UserType.FOLLOWING) {
            require(_followingUsers.contains(user), "NOTFWG");
        } else {
            require(_followersUsers.contains(user), "NOTFWR");
        }
        _;
    }

    modifier checkActive() {
        require(_isActive, "INACTV");
        _;
    }

    // GETTERS

    /**
     * @notice Get the License Token Address
     */
    function getBlockchainId() public view returns (uint) {
        return _blockchainId;
    }    

    /**
     * @notice initialize function
     * @param userMonitoringCenterAddress  user manager center address
     * @param userAddress user address
     * @param managerOwnerAddress  manager address
     * @param serviceManagerAddress  service Manager Address
     * @param licenseTokenAddress license Token Address
     * @param blockchainId blockchain Id
     */
    function initialize(
        address userMonitoringCenterAddress,
        address managerOwnerAddress,
        address userAddress,
        address serviceManagerAddress,
        address licenseTokenAddress,
        uint blockchainId
    ) public {
        require(!initialized, "Contract instance has already been initialized");
        _userManager = userMonitoringCenterAddress;
        _managerOwner = managerOwnerAddress;
        _owner = userAddress;
        _setupRole(OWNER_ROLE, _owner);
        _setupRole(MANAGER_ROLE, _managerOwner);
        serviceManagerInstance = ServiceManager(serviceManagerAddress);
        licenseTokenInstance = LicenseToken(licenseTokenAddress);
        userMonitoringCenterInstance = UserMonitoringCenter(userMonitoringCenterAddress);
        _blockchainId = blockchainId;
        initialized = true;
        _isActive = true;
    }

    /**
     * @notice change manager
     * @dev function is created in case of management center replacement
     * @param newManagementCenterAddress manager Transaction Feed
     */
    function transferManagement(address newManagementCenterAddress) public {
        require(
            // Only manager's owner can change manager
            _managerOwner == _msgSender(),
            "UNAUTH"
        );
        _managerOwner = newManagementCenterAddress;
    }       

    /**
     * @notice change manager
     * @dev function is created in case of management center replacement
     * @param isActive isActive variable
     */
    function setActivity(bool isActive) public {
        require(hasRole(MANAGER_ROLE, _msgSender()),
            "UNAUTH"
        );
        _isActive = isActive;
    }

    /**
     * @notice Set user permissions for an address
     * @param recipient added address
     * @param userType FOLLOWING, FOLLOWERS
     * @param permissions permissions added with
     * @param nickname nickname
     */
    function setUserPermissionsNicknameAndInfo(
        address recipient,
        uint256 permissions,
        UserType userType,
        bytes32 nickname,
        bytes32 info1,
        bytes32 info2
    ) public checkActive {
        require(hasRole(OWNER_ROLE, _msgSender()), "UNAUTH");
        _nicknames[recipient] = nickname;
        setAddressInfo(recipient, info1, info2);
        return
            setUserPermissions(
                recipient,
                permissions,
                userType
            );
    }

    /**
     * @notice Set user permissions for an address
     * @param recipient added address
     * @param userType FOLLOWING, FOLLOWERS
     * @param permissions permissions added with
     * @param nickname nickname
     */
    function setUserPermissionsAndNickname(
        address recipient,
        uint256 permissions,
        UserType userType,
        bytes32 nickname
    ) public checkActive {
        require(hasRole(OWNER_ROLE, _msgSender()), "UNAUTH");
        _nicknames[recipient] = nickname;
        return
            setUserPermissions(
                recipient,
                permissions,
                userType
            );
    }

    /**
     * @notice Set user permissions for an address
     * @param recipient added address
     * @param userType FOLLOWING, FOLLOWERS
     * @param permissions permissions added with
     */
    function setUserPermissions(
        address recipient,
        uint256 permissions,
        UserType userType
    ) public checkActive {
        require(hasRole(OWNER_ROLE, _msgSender()), "UNAUTH");
        require(permissions != 0, "NDPER");
        if (userType == UserType.FOLLOWING) {
            require(
                _followingUsersPermissions[recipient] != permissions,
                "ERRPER"
            );
            _followingUsers.add(recipient);
            _followingUsersPermissions[recipient] = permissions;
            emit FollowinUserPermissionSettled(recipient, permissions);
        } else {
            require(
                _followersUsersPermissions[recipient] != permissions,
                "ERRPER"
            );
            _followersUsers.add(recipient);
            _followersUsersPermissions[recipient] = permissions;
            emit FollowerUserPermissionSettled(recipient, permissions);
        }
    }

    /**
    * @notice get all users FOLLOWING or FOLLOWERS for the address.
    * @param userType true(FOLLOWING), false(FOLLOWERS)
    * Return the entire set in an array
    //
    // WARNING	This operation will copy the entire storage to memory,
    // which can be quite expensive. This is designed to mostly be used by view
    // accessors that are queried without any gas fees.
    // Developers should keep in mind that this function
    // has an unbounded cost, and using it as part of a state-changing
    // function may render the function uncallable if the set grows to a
    // point where copying to memory consumes too much gas to fit in a block.
    */
    function getAllUsers(UserType userType)
        public
        view
        checkActive
        returns (address[] memory)
    {
        require(hasRole(OWNER_ROLE, _msgSender()), "UNAUTH");
        return
            userType == UserType.FOLLOWING
                ? _followingUsers.values()
                : _followersUsers.values();
    }

    /**
     * @notice Remove follower.
     * @param user foolowe user to be removed
     * @param userType FOLLOWING), FOLLOWERS)
     * the user can remove itself
     */
    function removeUsers(address user, UserType userType)
        public
        checkActive
        onlyFollowingOrFollowerUsers(user, userType)
    {
        require(hasRole(OWNER_ROLE, _msgSender()), "UNAUTH");
        if (userType == UserType.FOLLOWING) {
            _followingUsers.remove(user);
            _followingUsersPermissions[user] = 0;
            emit FollowinUserPermissionSettled(user, 0);
        } else {
            _followersUsers.remove(user);
            _followersUsersPermissions[user] = 0;
            emit FollowerUserPermissionSettled(user, 0);
        }                                                                           
    }

    /**
     * @notice get open reading services pool
     */
    function getUserPermissions(address user, UserType userType)
        public
        view
        checkActive
        returns (uint256)
    {
        if (userType == UserType.FOLLOWING)
            return _followingUsersPermissions[user];
        else return _followersUsersPermissions[user];
    }

    /**
     * @notice self Remove viewer. If user dont want to follow the current user,
     * the user can remove itself
     */
    function followerUserSelfRemove()
        public
        checkActive
        onlyFollowingOrFollowerUsers(_msgSender(), UserType.FOLLOWER)
    {
        _followersUsers.remove(_msgSender());
        _followersUsersPermissions[_msgSender()] = 0;
        emit FollowerUserPermissionSettled(_msgSender(), 0);
    }

    /**
     * @notice follower User Get Own Permissions
     */
    function followerUserGetOwnPermissions()
        public
        view
        checkActive
        onlyFollowingOrFollowerUsers(_msgSender(), UserType.FOLLOWER)
        returns (uint256)
    {
        return _followersUsersPermissions[_msgSender()];
    }
    /**
     * @dev get data function from viewres
     * @param user the function follower
     * @param follower the function follower
     * @param serviceId the service id of the wanted hash
     */
    function isFollowerAllowed(
        address user,
        address follower,
        uint256 serviceId
    ) public view checkActive returns (bool) {
        require(_owner == user, "BADRQ");
        if (userMonitoringCenterInstance.isOpenReadingService(serviceId)) {
            return true;
        } else {
            if (!_followersUsers.contains(follower)) return false;
            // require the viewer are allowed to get data for the required service
            return
                LicenseTools.getBoolean(
                    _followersUsersPermissions[follower],
                    serviceId
                );
        }
    }

    /**
     * @notice set user nickname
     * @param user user
     * @param nickname nickname
     */
    function setUserNickname(address user, bytes32 nickname)
        public
        checkActive
    {
